import React from "react";

const Footer = () => {
  const year = new Date().getFullYear();
  return (
    <footer className="footer "
     style={{
      width: "100%",
      textAlign: "center",
      padding: "12px 0",
      backgroundColor: "#fff3e6",
      color: "#8b5e3c",
      fontSize: "14px",
      position: "fixed",
      bottom: 0,
      left: 0,
    }}
    >
      &copy; {year} RATE RIGHT. All rights reserved.
    </footer>
  );
};

export default Footer;
